            }

            //
            string word = "MAS";
            //Una guarrada a ver si funciona
            int wordFigureValue = word[1] + word[2] + word[2] + word[0] + word[0];
            int[] dx = new int[] { 1, -1 };
            int count = 0;

            Console.WriteLine(word[2] + 0);

            //Search at table
            for (int y = 0; y < table.Count; y++)
            {
                for (int x = 0; x < table[y].Count; x++)
                {
                    if (table[y][x] == word[1])
                    {
                        int thisFigureValue = word[1];
                        string letters = "";

                        //Add the default coordinates to current to check around the letter
                        foreach (var coordinateX in dx)
                        {
                            //check if this coordinate oversize the table
                            int xCheck = coordinateX + x;
                            if (xCheck < 0 || xCheck >= table[y].Count)
                            { continue; }

                            foreach (var coordinateY in dx)
                            {
                                //check if this coordinate oversize the table
                                int yCheck = coordinateY + y;
                                if (yCheck < 0 || yCheck >= table.Count)
                                { continue; }

                                if (table[yCheck][xCheck] == word[0] || table[yCheck][xCheck] == word[2])
                                {
                                    letters += table[yCheck][xCheck];
                                    thisFigureValue += table[yCheck][xCheck];
                                    //El valor tiene que ser el mismo que el de la figura marcada y además como son solo 3 letras se puede comprobar que no es SAS comprobando las dos letras de en medio
                                    if (thisFigureValue == wordFigureValue && letters[1] != letters[2])
                                    {
                                        count++;
                                    }
                                }

                            }

                        }
                    }

                }
            }

            Console.WriteLine(count);
        }
